import React from 'react';

const GenderMenu=() => {
    return (
        <div>
            <h1>
                Gender:
            </h1>
            <select id="days_per_week" placeholder="None">
                <option>1</option>
                <option>2</option>
                <option>3</option>
            </select>
        </div>

    )
}

export default GenderMenu
